import React from 'react';
import '../../css/home.css';

const Home = () => {
  return (
    <div class="content">
      <h1 class="title">SHAREHOME</h1>
      <p class="subtitle">
        A party game inspired by <a href="http://www.terrace-house.jp/">Terrace House</a>
      </p>
      <p class="subtitle">
        Become members and reenact your favorite scenes!
      </p>
      <p class="subtitle">
        <a href="/play">Play virtually with friends right now</a> or <a href="/buy">purchase a physical copy</a> for when social distancing becomes lame again.
      </p>
    </div>
  );
}

export default Home;
